import React, {useState} from 'react';
import './assets/css/projects.css';

const Projects = () => {
    return (
        <div id='projects'>
            <h2>Projects</h2>
            <div class="clear"></div>
            <div class="project-container">
                <div class="project-card">
                    <h3>ClikEat Cafe</h3>
                    <h6><em>ClickEat Cafe is a coffee shop established and opened their first branch on January of 2017 at Bugallon, Pangasinan. As of this day they have 3 branches. ClickEat Cafe Mangatarem and ClickEat Cafe Sual. They are also affiliated with Cafe Ben and Kape Crucero. Cafe Ben is located in Urbiztondo, Pangasinan and the two branches of Kape Crucero is located in Malolos, Bulacan.</em></h6>
                    <ul>
                        <li>Developed a secure website integrated with chatbot for an automobile client using HTML, CSS, JavaScript and IBM Watson Assistant</li>
                    </ul>
                </div>
                <hr/>
            </div>
        </div>
    );
};

export default Projects;
